window.bookSummaryJSON = "<p><b>Heroes aren’t born; they’re made. But so are villains. </b></p> <p>Raine Campbell never knew she was special until her dormant magic unleashed to protect her friends.&nbsp;</p> <p>But it couldn’t be contained or controlled.&nbsp;</p> <p>Enter the School of Necessary Magic, where magical teens are taught to master their abilities and maybe learn some math.&nbsp;</p> <p>During a forbidden trip into the massive underground city beneath the school - off limits to freshmen - Raine discovers druids are disappearing. And no one seems to care.&nbsp;</p> <p>Refusing to stand by and ignore it like everyone else, she dives into an increasingly dangerous plot to rescue them before the balance the druids maintain tips into chaos.&nbsp;</p> <p>But doing so requires breaking rules that could lead to her expulsion and threatens to end her dream of working as a witch for the FBI, following in the footsteps of her father and uncle.&nbsp;</p> <p>Join Raine on an action-packed adventure of magic and mayhem.&nbsp;</p> <p><b>After all, rules are just guidelines, right? </b></p> <p>Say hello to old friends and meet the new freshman class at the School of Necessary Magic.&nbsp;</p> <p><b>NOTE: While the series continues in the same world with some returning characters, it does stand alone. No prior experience necessary.</b></p>"; 
